#include <stdio.h>
#include <stdbool.h>
#include <stdlib.h>

struct problem {
    int a, b;
};

bool get_problem (struct problem *p) {

    bool success = false;
    char *line = NULL;
    size_t len = 0;
    ssize_t read;

    read = getline(&line, &len, stdin);
    if (read > 2 && sscanf(line, "%d %d", &p->a, &p->b) == 2) {
        success = true;
    }

    free(line);
    return success;
}


int main (int argc, char *argv[]) {

    struct problem p;
    while (get_problem(&p)) {
        printf("%d\n", p.a + p.b);
    }

    return EXIT_SUCCESS;
}

