unsigned long long countingPartition(unsigned a){
    if(a<2){
        return 1;
    }
    //unsigned long long array[a+1];
    unsigned long long tmp;
    unsigned long long * array;
    array = (unsigned long long*) calloc (a+1,sizeof(unsigned long long));
    unsigned b=1;
    unsigned c=a/2;
    array[0]=1;
    for(unsigned i=1;i<=a;i++){
        array[i] = 0;
    }
    while(b<=c){
        b=b<<1;
    }
    while(b!=0){
        unsigned i=b;
        while(i<=a){
            tmp = array[i]+array[i-b];
            array[i] = tmp % 1000000;
            i=i+b;
        }
        b=b/2;
    }
    return array[a];
}

